// Wenn nach 21Uhr die Tür geöffnet wird,
// Garderobe und Küchenarbeitsplatte einschalten
// Wenn dann Küche ausgemacht wird,
on({ id: '0_userdata.0.Türen/Fenster.Garage.Garage' /* Garage */, change: 'ne' }, async (obj) => {
  let value = obj.state.val;
  let oldValue = obj.oldState.val;
  if (!getState('0_userdata.0.Zeitfunktionen.Urlaub').val) {
    if (!getState('0_userdata.0.Zeitfunktionen.Wochenende').val) {
      if (getState('0_userdata.0.Zeitfunktionen.Schicht').val == 2) {
        if (compareTime('22:00', '23:00', 'between', null)) {
          if (getState('0_userdata.0.Türen/Fenster.Garage.Garage').val == 0) {
            if (!getState('ping.0.ioBroker-Futro.192_168_1_101.alive').val) {
              if ((new Date().getDay() === 0 ? 7 : new Date().getDay()) != 5) {
                setState('0_userdata.0.Geräte.Zigbee.2OG.Ost.monitore' /* 2OG.Ost.monitore */, true);
              }
              sendTo("telegram.0", "send", {
                  text: 'Haustür wird geöffnet!',
                  user: 'Chriss',
                  parse_mode: "HTML"
              });
              await wait(10000);
              setState('nuki-extended.0.smartlocks.haustür._ACTION.UNLATCH' /* Trigger UNLATCH action */, true);
            }
          }
        }
      }
    }
  }
});
